/**
 * 判断数字的单位，如px,%等,如果传入的数字有单位则不做任何处理，如果没有单位则默认加入指定的单位
 * 如传入100px或100%则不做处理，如传入100则会在后面加上默认单位“px”
 * @param {Object} num	数字
 * @param {String} dfUnit	默认单位，默认为"px"
 */
function lCheckUnit (num,dfUnit) {
	if(dfUnit==undefined)	dfUnit="px"
	if(isNaN(num))
	{
		return num
	}else{
		return num+dfUnit
	}
}

/**
 * HTMLDecode
 */
function lHTMLDecode(text)
{
	var temp = document.createElement("div");
	temp.innerHTML = text;
	var output = temp.innerText || temp.textContent;
	temp = null;
	return output;
} 

/**
 * 返回字符数，中文为2个字符
 * @param {string} str	字符
 */
function lStrLength(str)
{
	var len=0;
	for(var i=0;i< str.length;i++)
	{
		if (str.charAt(i)>'~')
		{
			len+=2;
		}else{
			len++
		}
	}
	
	return len;
}

/**
 * 判断字符是否有中文字符  汉字
 * @param {Object} s
 */
function lIsHasChn(s)  {   
    var patrn= /^[\u4E00-\u9FA5]+$/;
    if (!patrn.exec(s)){   
        return false;   
    }else{   
        return true;   
    }   
}

/**
 * 判断字符是否是英文字符
 * @param {Object} s
 */
function lIsEnStr(s)  {   
    var patrn= /^[a-zA-Z]+$/;
    if (!patrn.exec(s)){
        return false;   
    }else{   
        return true;   
    }
}

/**
 * 返回被限制的字符串
 */
function lMaxStrLength (str,maxLength) 
{
	var rStr=""
	var len=0;
	for(var i=0;i< str.length;i++)
	{
		if (str.charAt(i)>'~')
		{
			len+=2;
		}else{
			len++
		}
		
		if(len<=maxLength)
		{
			rStr+=str.charAt(i)
		}else{
			return rStr
		}
	}
	
	return rStr;
}

/**
 * 将参数拼接起来并返回
 * @param {object} arr	对象数组
 * @param {string} symbol	间隔符
 */
function lApt(arr, symbol) {
	if (symbol == undefined)
		symbol = ""

	var pString = ""
	for (var i = 1; i < arr.length; i++) {
		pString += arr[i]
		if (i < arr.length - 1) {
			pString += symbol
		}
	}
	return pString
}

